import './TodoItem.css';
import { Col, Container, Row } from 'react-bootstrap';

function TodoItem({todo, onDelete}) {
    return (

        <div className='box'>
            <Container fluid>
                <Row>
                    <Col xs={1} className='test1'><img className='Todo-check' src="../Assests/circle.png" alt="" fluid/></Col>
                    <Col xs={10} className='test1'><p className='Todo-text'>{todo.text}</p></Col>
                    <Col xs={1} className='test1'><img className='Todo-cancel' src="../Assests/icon-cross.svg" alt="" onClick={() => onDelete(todo.id)}/></Col>
                </Row>
            </Container>
        </div>

    );
}

export default TodoItem;
